// const StoreLoginData = (data, headers) 
const StoreLoginData = (props)=> {

    let newData = localStorage.setItem('data',(props.data))
    let newHeaders  = localStorage.setItem('headers',JSON.stringify(props.headers))
    console.warn('loginData=',newData)
}

export default StoreLoginData;
